import Login from './components/Login'
import Page16 from './components/Page16'
import { BrowserRouter, Switch, Route } from 'react-router-dom';
function App() {

    return (
      <Switch>
        <Route exact path="/" component={Login} />
        <Route exact path="/Page16" component={Page16} />
      </Switch>
    );
  }
